#         sum_num = sum(nums)
#         len_n = len(nums)
#         res = l = 0
#         while l < len_n and sum_num >= goal:
#             r, sum_now = len_n-1, sum_num
#             while l <= r and sum_now >= goal:
#                 if sum_now == goal:
#                     res += 1
#                 sum_now -= nums[r]
#                 r -= 1
#             sum_num -= nums[l]
#             l += 1
#         return res

class Solution:
    def numSubarraysWithSum(self, nums: List[int], goal: int) -> int:
        sum_dict, sum_num = {}, 0
        for num in nums:
            sum_num += num
            if sum_num not in sum_dict:
                sum_dict[sum_num] = 1
            else:
                sum_dict[sum_num] += 1
        if goal > sum_num:
            return 0
        res = sum_dict[goal] if goal in sum_dict else 0
        if goal == 0:
            for value in sum_dict.values():
                res += (value*(value-1)//2)
            return res
        for key in sum_dict.keys():
            if key+goal in sum_dict:
                res += (sum_dict[key]*sum_dict[key+goal])
        return res



